import styles from './TypeList.module.scss'

export const TypeList = ({typeList}) => {
  return (
    <ul>
      {
        typeList.map(type => {
          const {label, src, alt} = type
          return (
            <li className={styles.list}>
              <img
                src={src}
                alt={alt}
              />
              {label}
            </li>
            )
        })
      }
    </ul>
  )
}
